import React from "react";
import "./Btn.scss";

const btnTypeClass = {
  google: "google-sign-in",
  invert: "inverted",
};

function Btn({ children, btnType, ...other }) {
  return (
    <input className={`button-container  ${btnTypeClass[btnType]}`} {...other}>
      {children}
    </input>
  );
}

export default Btn;
